            <script>
            document.addEventListener('DOMContentLoaded', function() {
                // Add custom legend behavior after Plotly has loaded
                setTimeout(function() {
                    // Get all legend items
                    var legendItems = document.querySelectorAll('.legend .traces');
                    var groupTitles = {};
                    
                    // First pass - identify group titles
                    legendItems.forEach(function(item) {
                        var text = item.querySelector('.legendtext');
                        if (text && text.textContent.startsWith('Dive ')) {
                            // This is a dive title
                            groupTitles[text.textContent] = {
                                element: item,
                                behaviors: []
                            };
                        }
                    });
                    
                    // Second pass - associate behaviors with dives
                    legendItems.forEach(function(item) {
                        var text = item.querySelector('.legendtext');
                        if (text && !text.textContent.startsWith('Dive ')) {
                            // Find parent dive by checking legendgroup attribute
                            var legendGroup = item.getAttribute('data-legend-group');
                            if (legendGroup) {
                                var diveNum = legendGroup.split('_')[1];
                                var diveTitle = 'Dive ' + diveNum;
                                if (groupTitles[diveTitle]) {
                                    groupTitles[diveTitle].behaviors.push(item);
                                }
                            }
                        }
                    });
                    
                    // Add expand/collapse indicators
                    for (var title in groupTitles) {
                        var titleEl = groupTitles[title].element;
                        var expandIcon = document.createElement('span');
                        expandIcon.innerHTML = '▼';
                        expandIcon.style.marginRight = '5px';
                        expandIcon.style.cursor = 'pointer';
                        titleEl.insertBefore(expandIcon, titleEl.firstChild);
                        
                        // Set up click handler for expand/collapse
                        expandIcon.addEventListener('click', function(title, behaviors) {
                            return function(e) {
                                e.stopPropagation();
                                var isExpanded = this.innerHTML === '▼';
                                this.innerHTML = isExpanded ? '►' : '▼';
                                
                                behaviors.forEach(function(behavior) {
                                    behavior.style.display = isExpanded ? 'none' : 'block';
                                });
                            };
                        }(title, groupTitles[title].behaviors));
                        
                        // Initial state - collapsed
                        expandIcon.innerHTML = '►';
                        groupTitles[title].behaviors.forEach(function(behavior) {
                            behavior.style.display = 'none';
                        });
                    }
                }, 1000);
            });
            </script>
